	`athleteId` BIGINT NOT NULL AUTO_INCREMENT,
	`firstName` VARCHAR(255) NOT NULL,
	`lastName` VARCHAR(255) NOT NULL,
	`startHsYear` YEAR NOT NULL,
	`endHsYear` YEAR NOT NULL,
